import ReactDOM from 'react-dom'
import React from 'react'

function tick() {
    const element = (
        <div>
            <h1>Hello, world!</h1>
            <h2>It's {new Date().toLocaleTimeString()}.</h2>
        </div>
    );

    ReactDOM.render(
        element,
        document.getElementById('root')
    );
}

setInterval(tick, 1000)
